import React, { useEffect, useState } from "react";
import CreateSunfish from "./CreateSunfish";

function MultipleSunfish() {
    const [sunfishes, setSunfishes] = useState([]);

    const fetchSunfishes = async () => {
        const response = await fetch("http://127.0.0.1:8000/api/sunfish/");
        const data = await response.json();
        setSunfishes(data);
    };

    useEffect(() => {
        fetchSunfishes();
    }, []);

    return (
        <div>
            <CreateSunfish onSuccess={fetchSunfishes} />
            <h3>Sunfish List</h3>
            {sunfishes.map((sunfish, index) => (
                <div key={index}>
                    <p>Name: {sunfish.name}</p>
                    <p>Level: {sunfish.level}</p>
                    <p>Status: {sunfish.is_alive ? "Alive" : "Dead"}</p>
                </div>
            ))}
        </div>
    );
}

export default MultipleSunfish;
